import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-pdf-viewer',
  templateUrl: './pdf-viewer.component.html',
  styleUrls: ['./pdf-viewer.component.scss']
})
export class PdfViewerComponent implements OnInit {
devicemode: boolean = false;

    ngOnInit(): void {
      this.createAndBindPDFUrl();
      this.devicemode = this.isMobileOrTablet();
    }
   pdf_Byte:string="";
   pdfURL:string="";


   private createAndBindPDFUrl(): void {
 
    const byteCharacters = window.atob(this.pdf_Byte);
    const byteNumbers = new Array(byteCharacters.length);
    for (let i = 0; i < byteCharacters.length; i++) {
      byteNumbers[i] = byteCharacters.charCodeAt(i);
    }
    const byteArray = new Uint8Array(byteNumbers);
    const blob = new Blob([byteArray], { type: 'application/pdf' });
 
    this.pdfURL = URL.createObjectURL(blob);
    console.log(this.pdfURL)
 
  }
  printPdf(): void {
    const pdfViewerDiv = document.querySelector('.pdfViewer.removePageBorders');
    if (!pdfViewerDiv) {
      console.log('.pdfViewer.removePageBorders not found');
      return;
    }
   
    const canvasWrappers = pdfViewerDiv.querySelectorAll('.canvasWrapper');
    if (canvasWrappers.length === 0) {
      console.log('No .canvasWrapper found within .pdfViewer.removePageBorders');
      return;
    }
 
    const printWindow = window.open('', '_blank');
    if (!printWindow) {
      console.log('Unable to open print window');
      return;
    }
 
    printWindow.document.open();
    printWindow.document.write('<html><head><title>Agreement</title></head><body>');
 
    setTimeout(() => {
      canvasWrappers.forEach((canvasWrapper, index) => {
        const canvas = canvasWrapper.querySelector('canvas');
        if (canvas) {
          if (index > 0) {
            printWindow.document.write('<div style="page-break-before: always;"></div>');
          }
 
          const imageData = canvas.toDataURL('application/pdf');
          printWindow.document.write(`<img src="${imageData}" style="width:100%;">`);
        }
      });
 
      printWindow.document.write('</body></html>');
      printWindow.document.close();
      setTimeout(() => {
        printWindow.print();
      }, 500);
    }, 100);
  }
 
  openPdf() : void {
    window.open(this.pdfURL, '_blank');
  }

  isMobileOrTablet(): boolean {
    let isMobile : boolean  = false;
    let isTablet : boolean = false;
   
    const userAgent = window.navigator.userAgent.toLowerCase();
   
    isMobile =
      userAgent.indexOf('mobile') > -1 ||
      userAgent.indexOf('ipho') > -1 ||
      userAgent.indexOf('blackberry') > -1 ||
      userAgent.indexOf('webos') > -1 ||
      userAgent.indexOf('opera mini') > -1 ||
      userAgent.indexOf('android') > -1;
   
    isTablet =
      userAgent.indexOf('ipad') > -1 ||
      userAgent.indexOf('android') > -1 && userAgent.indexOf('mobile') === -1;
   
    if(isMobile || isTablet){
      return true
    }
    return false;
  }
   
}
